import React from "react";
import { Link } from "react-router-dom";
import ScrollAnimation from 'react-animate-on-scroll';
import "animate.css/animate.min.css";
import './style.css';

function Landing() {
    return(
        <div className="landing">
            <ScrollAnimation animateIn='fadeinLeft'>
                <h1><b>Hello, I'm Pat</b></h1>
            </ScrollAnimation>
            <h3>I'm a <b><i>Full Stack</i></b> Developer</h3>
            <br></br>
            <div className="buttons">
                <Link className="waves-effect waves-light blue darken-1 btn-large z-depth-0" to="/resume"><b>Resume</b></Link>
                <Link className="waves-effect waves-light blue darken-1 btn-large z-depth-0"to="/portfolio"><b>Portfolio</b></Link>
                <a className="waves-effect waves-light blue darken-1 btn-large z-depth-0"><i className="fab fa-github-square"></i></a>
                <a className="waves-effect waves-light blue darken-1 btn-large z-depth-0"><i className="fab fa-linkedin"></i></a>
            </div>
        </div>
    )
}

export default Landing;
